["def funcImp(arg1):
    if not isinstance(arg1, list) or not all((isinstance(i, int) for i in arg1)):
        raise ValueError('Input must be a list of integers')
    seen = set()
    result = []
    for num in arg1:
        if num not in seen:
            result.append(num)
            seen.add(num)
    return result"]

